  const [tarefas, setTarefas] = useState([{
    tarefa: 'React',
    tempo: '02:00:00'
  }, {
    tarefa: 'JavaScript',
    tempo: '01:00:00'
  }, {
    tarefa: 'TypeScript',
    tempo: '03:00:00'
  }
  ])
  return (
    <div className={style.AppStyle}>
      <Formulario />
      <Lista tarefas={tarefas}/>
      <Cronometro />        
    </div>
  );
}

